import React from "react";


const Form = () => {


    return (
        <>
            <div>
                <div id="container">
                    <h3> HELLO </h3>
                    <input type="text" placeholder="Enter Your Name" />
                    <button id="demo"> Submit </button>
                </div>
            </div>
        </>
    );
}


export default Form;
